/*
 * HTML5 Boilerplate
 *
 * What follows is the result of much research on cross-browser styling.
 * Credit left inline and big thanks to Nicolas Gallagher, Jonathan Neal,
 * Kroc Camen, and the H5BP dev community and team.
 *
 * Detailed information about this CSS: h5bp.com/css
 *
 * ==|== normalize ==========================================================
 * 
 * DO NOT CHANGE THIS FILE <-----------------------   
 * Update Styles: /includes/css/client.css   
 */


/* =============================================================================
   HTML5 display definitions
   ========================================================================== */

article, aside, details, figcaption, figure, footer, header, hgroup, nav, section { display: block; }
audio, canvas, video { display: inline-block; *display: inline; *zoom: 1; }
audio:not([controls]) { display: none; }
[hidden] { display: none; }


/* =============================================================================
   Base
   ========================================================================== */

/*
 * 1. Correct text resizing oddly in IE6/7 when body font-size is set using em units
 * 2. Prevent iOS text size adjust on device orientation change, without disabling user zoom: h5bp.com/g
 */

html { font-size: 100%; -webkit-text-size-adjust: 100%; -ms-text-size-adjust: 100%; }

html, button, input, select, textarea { font-family: sans-serif; color: #222; }

body { margin: 0; font-size: 14px; line-height: 1.4; }

/*
 * Remove text-shadow in selection highlight: h5bp.com/i
 * These selection declarations have to be separate
 * Also: hot pink! (or customize the background color to match your design)
 */
/*
::-moz-selection { background: #fe57a1; color: #fff; text-shadow: none; }
::selection { background: #fe57a1; color: #fff; text-shadow: none; }
*/


/* =============================================================================
   Links
   ========================================================================== */

a { color: #e58a00; }
a:visited { color: #e58a00; }
a:hover { color: #af2626; }
a:focus { outline: thin dotted; }

/* Improve readability when focused and hovered in all browsers: h5bp.com/h */
a:hover, a:active { outline: 0; }


/* =============================================================================
   Typography
   ========================================================================== */

abbr[title] { border-bottom: 1px dotted; }

b, strong { font-weight: bold; }

blockquote { margin: 1em 40px; }

dfn { font-style: italic; }

hr { display: block; height: 1px; border: 0; border-top: 1px solid #ccc; margin: 1em 0; padding: 0; }

ins { background: #ff9; color: #000; text-decoration: none; }

mark { background: #ff0; color: #000; font-style: italic; font-weight: bold; }

/* Redeclare monospace font family: h5bp.com/j */
pre, code, kbd, samp { font-family: monospace, serif; _font-family: 'courier new', monospace; font-size: 1em; }

/* Improve readability of pre-formatted text in all browsers */
pre { white-space: pre; white-space: pre-wrap; word-wrap: break-word; }

q { quotes: none; }
q:before, q:after { content: ""; content: none; }

small { font-size: 85%; }

/* Position subscript and superscript content without affecting line-height: h5bp.com/k */
sub, sup { font-size: 75%; line-height: 0; position: relative; vertical-align: baseline; }
sup { top: -0.5em; }
sub { bottom: -0.25em; }


/* =============================================================================
   Lists
   ========================================================================== */

ul, ol { margin:0px; padding:0px; }
dd { margin: 0 0 0 40px; }
nav ul, nav ol { list-style: none; list-style-image: none; margin: 0; padding: 0; }


/* =============================================================================
   Embedded content
   ========================================================================== */

/*
 * 1. Improve image quality when scaled in IE7: h5bp.com/d
 * 2. Remove the gap between images and borders on image containers: h5bp.com/i/440
 */

img { border: 0; -ms-interpolation-mode: bicubic; vertical-align: middle; }

/*
 * Correct overflow not hidden in IE9
 */

svg:not(:root) { overflow: hidden; }


/* =============================================================================
   Figures
   ========================================================================== */

figure { margin: 0; }


/* =============================================================================
   Forms
   ========================================================================== */

form { margin: 0; }
fieldset { border: 0; margin: 0; padding: 0; }

/* Indicate that 'label' will shift focus to the associated form element */
label { cursor: pointer; }

/*
 * 1. Correct color not inheriting in IE6/7/8/9
 * 2. Correct alignment displayed oddly in IE6/7
 */

legend { border: 0; *margin-left: -7px; padding: 0; white-space: normal; }

/*
 * 1. Correct font-size not inheriting in all browsers
 * 2. Remove margins in FF3/4 S5 Chrome
 * 3. Define consistent vertical alignment display in all browsers
 */

button, input, select, textarea { font-size: 100%; margin: 0; vertical-align: baseline; *vertical-align: middle; }

/*
 * 1. Define line-height as normal to match FF3/4 (set using !important in the UA stylesheet)
 */

button, input { line-height: normal; }

/*
 * 1. Display hand cursor for clickable form elements
 * 2. Allow styling of clickable form elements in iOS
 * 3. Correct inner spacing displayed oddly in IE7 (doesn't effect IE6)
 */

button, input[type="button"], input[type="reset"], input[type="submit"] { cursor: pointer; -webkit-appearance: button; *overflow: visible; }

/*
 * Re-set default cursor for disabled elements
 */

button[disabled], input[disabled] { cursor: default; }

/*
 * Consistent box sizing and appearance
 */

input[type="checkbox"], input[type="radio"] { box-sizing: border-box; padding: 0; *width: 13px; *height: 13px; }
input[type="search"] { -webkit-appearance: textfield; -moz-box-sizing: content-box; -webkit-box-sizing: content-box; box-sizing: content-box; }
input[type="search"]::-webkit-search-decoration, input[type="search"]::-webkit-search-cancel-button { -webkit-appearance: none; }

/*
 * Remove inner padding and border in FF3/4: h5bp.com/l
 */

button::-moz-focus-inner, input::-moz-focus-inner { border: 0; padding: 0; }

/*
 * 1. Remove default vertical scrollbar in IE6/7/8/9
 * 2. Allow only vertical resizing
 */

textarea { overflow: auto; vertical-align: top; resize: vertical; }

/* Colors for form validity */
input:valid, textarea:valid {  }
input:invalid, textarea:invalid { background-color: #f0dddd; }


/* =============================================================================
   Tables
   ========================================================================== */

table { border-collapse: collapse; border-spacing: 0; }
td { vertical-align: top; }



/* =============================================================================
   Chrome Frame Prompt
   ========================================================================== */

.chromeframe { margin: 0.2em 0; background: #ccc; color: black; padding: 0.2em 0; }


/* ==|== primary styles =====================================================
   Author:
   ========================================================================== */
















/* ==|== media queries ======================================================
   EXAMPLE Media Query for Responsive Design.
   This example overrides the primary ('mobile first') styles
   Modify as content requires.
   ========================================================================== */

@media only screen and (min-width: 35em) {
  /* Style adjustments for viewports that meet the condition */
}



/* ==|== non-semantic helper classes ========================================
   Please define your styles before this section.
   ========================================================================== */

/* For image replacement */
.ir { display: block; border: 0; text-indent: -999em; overflow: hidden; background-color: transparent; background-repeat: no-repeat; text-align: left; direction: ltr; *line-height: 0; }
.ir br { display: none; }

/* Hide from both screenreaders and browsers: h5bp.com/u */
.hidden { display: none !important; visibility: hidden; }

/* Hide only visually, but have it available for screenreaders: h5bp.com/v */
.visuallyhidden { border: 0; clip: rect(0 0 0 0); height: 1px; margin: -1px; overflow: hidden; padding: 0; position: absolute; width: 1px; }

/* Extends the .visuallyhidden class to allow the element to be focusable when navigated to via the keyboard: h5bp.com/p */
.visuallyhidden.focusable:active, .visuallyhidden.focusable:focus { clip: auto; height: auto; margin: 0; overflow: visible; position: static; width: auto; }

/* Hide visually and from screenreaders, but maintain layout */
.invisible { visibility: hidden; }

/* Contain floats: h5bp.com/q */
.clearfix:before, .clearfix:after { content: ""; display: table; }
.clearfix:after { clear: both; }
.clearfix { *zoom: 1; }



/* ==|== print styles =======================================================
   Print styles.
   Inlined to avoid required HTTP connection: h5bp.com/r
   ========================================================================== */

@media print {
  * { background: transparent !important; color: black !important; box-shadow:none !important; text-shadow: none !important; filter:none !important; -ms-filter: none !important; } /* Black prints faster: h5bp.com/s */
  a, a:visited { text-decoration: underline; }
  abbr[title]:after { content: " (" attr(title) ")"; }
  .ir a:after, a[href^="javascript:"]:after, a[href^="#"]:after { content: ""; }  /* Don't show links for images, or javascript/internal links */
  pre, blockquote { border: 1px solid #999; page-break-inside: avoid; }
  thead { display: table-header-group; } /* h5bp.com/t */
  tr, img { page-break-inside: avoid; }
  img { max-width: 100% !important; }
  @page { margin: 0.5cm; }
  p, h2, h3 { orphans: 3; widows: 3; }
  h2, h3 { page-break-after: avoid; }
}


/* Full Media Global Improvements ==================================== */

/* headings */
h1, .h1 { 
	font-size: 45px; 
	font-family: "rosewood-std-fill", sans-serif; 
	color: #af2626; 
	text-transform: uppercase; 
	padding:0px; 
	margin: 0px; 
	margin-bottom: 20px; 
	letter-spacing: -0.05em;
	line-height: 35px;
}

h2, .h2, h3, .h3, h4, .h4 { font-family: "felt-tip-roman",sans-serif; font-style: normal; font-weight: 400; }

h2, .h2 { font-size: 35px; color: #9a7250; margin: 0px; margin-bottom: 10px; line-height: 38px;  }
h3, .h3 { font-size: 30px; color: #372d28; margin: 0px; margin-bottom: 10px; line-height: 35px; }

.clearall { clear:both; }

/*** ESSENTIAL STYLES ***/
.sf-menu, .sf-menu * {
	margin:			0;
	padding:		0;
	list-style:		none;
}
.sf-menu {
	line-height:	1.0;
	width: 100%;
}
.sf-menu ul {
	position:		absolute;
	top:			-999em;
	width:			200px; /* left offset of submenus need to match (see below) */
}
.sf-menu ul li {
	width:			100%;
}
.sf-menu li:hover {
	visibility:		inherit; /* fixes IE7 'sticky bug' */
}
.sf-menu li {
	float:			left;
	position:		relative;
}
.sf-menu a {
	display:		block;
	position:		relative;
}
.sf-menu li:hover ul, .sf-menu li.sfHover ul {
	left:			0;
	top:			70px; /* match top ul list item height */
	z-index:		99;
}
ul.sf-menu li:hover li ul, ul.sf-menu li.sfHover li ul {
	top:			-999em;
}
ul.sf-menu li li:hover ul, ul.sf-menu li li.sfHover ul {
	left:			200px; /* match ul width */
	top:			0;
}
ul.sf-menu li li:hover li ul, ul.sf-menu li li.sfHover li ul {
	top:			-999em;
}
ul.sf-menu li li li:hover ul, ul.sf-menu li li li.sfHover ul {
	left:			200px; /* match ul width */
	top:			0;
}
/*** SITE THEME ***/
.sf-menu {
	float:			right;
}
.sf-menu a {
	padding: 0px 14px;
	text-decoration: none;
}
.sf-menu a, .sf-menu a:visited { /* visited pseudo selector so IE6 applies text colour*/
	color: white;
	font-family: "rosewood-std-fill", sans-serif;
}

.sf-menu li.first { display: none; }

.sf-menu li {
	font-size: 19px;
	/*border-right: 1px solid #584b45;*/
	cursor: pointer;
	line-height: 70px;
	background: url(/images/shanes-nav-div-002.jpg) no-repeat right center;
	text-shadow: 2px 1px 5px #000;
	filter: dropshadow(color=#000, offx=2, offy=1);

	
}
.sf-menu li.tnav-shop  { background: none; }
.sf-menu li li {
	margin: 0;
	padding: 0;
	font-size: 12px;
	/*background: #a30a21;*/
	background: none !important;
	border-right: 0px;
	border-bottom: 1px solid #584b42;
	line-height: 70px;
}
.sf-menu li li a {
	line-height: normal;
	padding: 10px;
	font-family: Arial, Helvetica, "Helvetica Neue", sans-serif !important;
}
.sf-menu li li li {
	background:		#9AAEDB;
}
.sf-menu li li li a {
}
/*- -HOVER --*/
.sf-menu li:hover, .sf-menu li.sfHover, .sf-menu a:focus, .sf-menu a:hover, .sf-menu a:active {
	background:url(/images/background-patterns/shanes-navbg-hvr-001.jpg) repeat-x top center;
	outline: 0 none;
	-webkit-transition: background-color .15s ease-in;
	-moz-transition: background-color .15s ease-in;
	-o-transition: background-color .15s ease-in;
	transition: background-color .15s ease-in;
}
.sf-menu li li a:hover {
	background:none;
	background-color:#927d71;
}

.sf-menu .fmtactive {
	background:url(/images/background-patterns/shanes-navbg-hvr-001.jpg) repeat-x top center;
}
/*** arrows **/
.sf-menu a.sf-with-ul {
	padding-right: 	auto; /* if there is no sub indicator -- remove padding on this element */
	min-width:		1px; /* trigger IE7 hasLayout so spans position accurately */
}
.sf-sub-indicator {
	position:		absolute;
/*	display:		block; */
	top:			1.05em; /* IE6 only */
	width:			10px;
	height:			10px;
	text-indent: 	-999em;
	overflow:		hidden;
	background:		url('../images/arrows-ffffff.png') no-repeat -10px -100px; /* 8-bit indexed alpha png. IE6 gets solid image only */
	/*--*/
	display: none;
}
a > .sf-sub-indicator {  /* give all except IE6 the correct values */
	top:			15px;
	background-position: 0 -100px; /* use translucent arrow for modern browsers*/
}
/* apply hovers to modern browsers */
a:focus > .sf-sub-indicator, a:hover > .sf-sub-indicator, a:active > .sf-sub-indicator, li:hover > a > .sf-sub-indicator, li.sfHover > a > .sf-sub-indicator {
	background-position: -10px -100px; /* arrow hovers for modern browsers*/
}
/* point right for anchors in subs */
.sf-menu ul .sf-sub-indicator {
	background-position:  -10px 0;
}
.sf-menu ul a > .sf-sub-indicator {
	background-position:  0 0;
}
/* apply hovers to modern browsers */
.sf-menu ul a:focus > .sf-sub-indicator, .sf-menu ul a:hover > .sf-sub-indicator, .sf-menu ul a:active > .sf-sub-indicator, .sf-menu ul li:hover > a > .sf-sub-indicator, .sf-menu ul li.sfHover > a > .sf-sub-indicator {
	background-position: -10px 0; /* arrow hovers for modern browsers*/
}
/*** shadows for all but IE6 ***/
.sf-shadow ul {
	-webkit-box-shadow: 0px 10px 15px 0px rgba(0, 0, 0, .3);
	-moz-box-shadow: 0px 10px 15px 0px rgba(0, 0, 0, .3);
	box-shadow: 0px 10px 15px 0px rgba(0, 0, 0, .3);
	background: #4a3e37; 
}
.sf-shadow ul ul {
	background: #594c45; 
}

.sf-shadow ul.sf-shadow-off {
	background: transparent;
}


/* WEBSITE STYLES */

/* Left Navigation Styles */

.xleftnav {
	padding-bottom: 40px;
	background-position: bottom center;
	margin-top: 0px;
	background-repeat: no-repeat;
}
.fmlnav, .blog-nav-block {
	padding: 15px 0;
	margin: 0px;
	width: 87.7%;
	margin: auto;
	background:url(/images/background-patterns/shanes-xln-chalkbg.jpg) repeat top center;
	-webkit-box-shadow: inset 0px 0px 15px 3px rgba(0, 0, 0, .4);
	box-shadow: inset 0px 0px 15px 3px rgba(0, 0, 0, .4);
}
.blog-nav-block  {
	padding: 15px 6%;
	width: 75.5%;
}
.fmlnav li {
	font-size: 14px;
	list-style: none outside none;
	margin: 0;
	padding-top: 0;
}
/* class applied to active links */
#xint .fmlactive {
	color:#d0b9a4;
}
.fmlnav li.fmlfirst {
}
.fmlnav li.fmllast {
}
.fmlnav li a {
	font-size: 24px;
	display: block;
	padding:8px 15px;
	text-decoration:none;
	color: white;
	font-family: "rosewood-std-fill", sans-serif;
	line-height: 33px;
}
.fmlnav li a:hover {
	color:#d0b9a4;
}
/* ################### Level Two ################### */
.fmlnav ul li {
	border: none;
}
.fmlnav ul { }
.fmlnav ul li a {
	padding: 0px 10px;
	border: none;
	font-size: 13px!important;
	font-family: Arial, Helvetica, "Helvetica Neue",  sans-serif
}
.fmlnav ul li a:hover {
}
.fmlnav ul li {
	border: 0px;
	line-height: normal;
}
.fmlnav ul ul {
	margin-left: 0px;
}
.fmlnav ul ul a {
	padding: 3px 5px;
}
.fmlnav ul li.fmlfirst {
}
.fmlnav ul li.fmllast {
	border-bottom: 0px solid #aaa;
}
.fmlnav ul li .fmlactive {
}
/* ################### Level Three ################### */
.fmlnav ul ul li { }
.fmlnav ul ul li a {
	padding: 5px 25px;
}
.fmlnav ul ul li a:hover {
}
.fmlnav ul ul li.fmlfirst {

}
.fmlnav ul ul li.fmllast {
}
.fmlnav ul ul li .fmlactive {
}
.fmlnav ul ul li {
	font-size: 12px;
}
/* ################### Level Four ################### */
.fmlnav ul ul ul li {
	border-top: 1px solid #eee;
	background: white;
}
.fmlnav ul ul ul li a {
	padding: 3px 45px;
	font-size:11px;
}
.fmlnav ul ul ul li a:hover {
}
div.xleftnav .fmlnav li ul li a {
	color: black;
}


/* == LEFT NAVIGATION WEBSITE STYLES
=============================================== */

.xln-wrapper { -webkit-box-shadow:  0px 0px 10px 0px rgba(0, 0, 0, .4);  box-shadow:  0px 0px 10px 0px rgba(0, 0, 0, .4);}

.xlnav-bg { background: url(/images/background-patterns/shanes-xln-ybg.jpg) repeat top left;}

.xlnav-top-bdr.blogarchsec { margin-top: 20px; }
.xlnav-top-bdr, .xlnav-bot-bdr { background:url(/images/background-patterns/shanes-xln-xbg.jpg) repeat-x top center; height: 15px; width: 100%; }
.xlnav-top-bdr .xln-left { background: url(/images/background-patterns/shanes-xln-xbg-topl.jpg) no-repeat top left; height: 15px; width: 16px; float : left; }
.xlnav-top-bdr .xln-right { background: url(/images/background-patterns/shanes-xln-xbg-topr.jpg) no-repeat top left; height: 15px; width: 16px;  float: right ;}

.xlnav-bot-bdr { }
.xlnav-bot-bdr .xln-left { background: url(/images/background-patterns/shanes-xln-xbg-botl.jpg) no-repeat top left; height: 15px; width: 16px;  float: left ; }
.xlnav-bot-bdr .xln-right { background: url(/images/background-patterns/shanes-xln-xbg-botr.jpg) no-repeat top left; height: 15px; width: 16px;  float: right ; }

/*---------------------------------
 Responsive
---------------------------------*/

@media (min-width:2200px) {
	.xwrapper {	padding: 0px 50px;	width: 1200px}
}


@media (max-width:1024px) {
	.hdr_xsocial { margin-right: 30px; }
	#xint .xcontent { width: 67%; padding-right: 5%; padding-bottom: 20px; }
	#xint.xlayout-layout .xcontent  { width: 100%; margin: auto; padding: 0 0 15px; }

/*#accessibility-controls { display: none; }*/
	.tblemenu { margin: 3.5% auto 0; }

	.flex-direction-nav .flex-next { right: 30px!important; }
	.flex-direction-nav .flex-prev { left: 30px!important; }

	/*-- Internal page styles --*/
	.xpagebodytext p img, .xpagebodytext img { width: 100%!important; height: auto!important; margin: auto; float: none!important; }
}

@media (max-width:1015px) {
	.xwrapper { width: 95%; }

	.header-right { width: 75%; }

	.xcnt-top-bdr, .xcnt-bot-bdr { width: 100%; }
	.sf-menu li { font-size: 18px!important; }
	.sf-menu li li { font-size: 12px!important; }

	.sf-menu a { padding: 0px 12px; }

	.sp-woodframe { width: 95%; }
	.splash-struct { height: 515px; }
	.ftr-wrapper { width: 95%; }
	.ftr-img-bg { width: 100%; }

	.loc-search { font-size: 26px; }

	.ls-callouts a.cta-co, .ls-callouts a.cta-mu { width: 48%; }
	.tblemenu td img, .ls-callouts img, .ls-table img { width: 100%!important; height: auto!important; }

}

@media (max-width:1006px) {
	.sf-menu li { font-size: 16px!important; }
	.loc-search { font-size: 24px; }

	.page-home .xfull { width: 70%; }

	ul.fmlnav li a { font-size: 22px; padding: 5px 15px; }
	.ropewrap { width: 29%; }
}

@media (max-width:997px) {
	.xlogo { width: 20%; height: auto; }
	.xlogo a img { width: 100%; height: auto; }
	header { margin-bottom: 45px;}
	nav { /*width: 80%;*/ }

	.ftr-wrapper {	width: 86%;	padding: 7%; }

	.bcrumbs {	width: 100%!important;	padding-top: 3%; }

	ul.fmlnav li a { font-size: 20px; }
}

@media (max-width:930px) {

	header { margin-bottom: 75px; }
	.ftr-wrapper { padding: 2% 4%; }

/* HOMEPAGE STYLES
------------------------------------------ -- */
	.splash-struct { height: 465px; }

		.hppage-img { display: none; }
	.page-home .xfull { width: 100%; float: none; }
	.hp_news { width: 100%; margin-right: 1%; }

/*-- LOCATIONS SEARCH PAGE STYLES ----------------- --*/
	table.loc-listing tr { width: 100%; display: inline-block; }
	table.loc-listing td { width: 23%; padding: 1%; float: left; }

	.formrow .lrn-btn a { padding: 5% 10%!important; }

}


@media (max-width:885px) {
	#xheader .xwrapper { width: 100%;}

/* MENU PAGE STYLES
------------------------------------------ -- */
	table.tblemenu tr {	width: 100%; display: block; }
	table.tblemenu td {	display: block; width: 47%; float: left; }

	.menuloc { border-bottom: 1px solid #a08b7c; }
	table.menuloc td { width: 100%; display: block; }
	.loc-search { text-align: center; font-size: 30px; margin-bottom: 15px; }

	table.menuloc td.loc-locations, table.menuloc td.loc-gluten { width: 50% !important; display: table; float: left; text-align: center; }
	table.menuloc td.loc-locations img, table.menuloc td.loc-gluten img { margin-bottom: 30px; }

/*-- LOCAL SITE PAGE STYLES ----------------- --*/
	.ls-main-content { width: 100%; float: none; }
	.ls-widget { float: none; margin: auto; }

}

@media (max-width:850px) {
	.sf-menu li { font-size: 15px!important;}
}

@media (max-width:830px) {
	.footer-subnav { line-height: 30px; }
}

@media (max-width:805px) {
	.sf-menu a { padding: 0px 10px;}

/* INTERNAL PAGE STYLES
------------------------------------------ -- */
	.xleftnav {	width: 100%; }
	.fmlnav li { display: none; }
	.fmlnav li.fmlactive, .fmlnav li.fmlactive li {	display: block; }

	.sf-menu * { }
	.sf-menu ul, .sf-sub-indicator { /*display: none!important;*/ }

	ul.fmlnav ul {	margin-left: 0px!important; }
	ul.fmlnav li a { font-size: 24px; }
	ul.fmlnav ul a { font-size: 15px; }

	#xint .xcontent {
		width: 95%;
		margin: auto;
		float: none;
		padding-right: 0;
	}
	#xint.xlayout-layout .xcontent { width: 95%; }

