/* CSS Document */


body {
	background-color: #cba894;
	background:url(/images/background-patterns/shanes-wood-bg-001.jpg) repeat top center;
	font-size: 13px;
}

.xstructure { background:url(/images/background-patterns/shanes-awning-002.png) repeat-x top center; }
.xcontainer { }

.xwrapper {
	width: 1000px;
	margin-left: auto;
	margin-right: auto;
}

/*-- START HEADER STYLES---- --*/

header {
	width: 100%;
	padding: 0;
	margin: auto;
}


h1.logo a {	display: block;}

.xlogo {
	float: left;
	width: 205px;
	height: 205px;
	margin-bottom: 0px;
	opacity: 1;
	z-index: 101;
	position: relative;
	/*--*/
	transition-property: opacity;
	-moz-transition-property: opacity;
	-webkit-transition-property: opacity;
	transition-duration: .1s;
	-moz-transition-duration: .1s;
	-webkit-transition-duration: .1s;
	transition-timing-function: ease-in;
	-moz-transition-timing-function: ease-in;
	-webkit-transition-timing-function: ease-in;
}

.xlogo:hover {	opacity: .8;}

.header-subnav {
	text-align: right;
	padding-top: 6px;
	font-size: 12px;
	display: none;
}
.header-subnav ul {	float: right;}
.header-subnav ul li {	list-style: none;	float: left;}
.header-subnav ul li a {
	text-decoration: none;
	color: #777;
	padding-left: 12px;
}

.xlogo span {	display: none;}
.header-right {	float: right;}

.header-right .xsearch { margin: 10px 10px 0; float: left;}
.header-right .xsearch form {	float: right;}
.header-right .xsearch input {	font-family: Arial, Helvetica, sans-serif;	font-size: 12px; border: none; padding: 4px; margin-right: 3px; color: #382F2A;}
.xsearch button {background: none; border: none; color: white;}
.xsearch i:hover {opacity: .75;}
.xsearch button i.search-icon {font-size: 18px; text-shadow: 2px 1px 3px rgba(0, 0, 0, 0.5);}
.xsearch button, .xsearch input {float: left;}

.xheaderimg {	width: 100%;}
.xheaderimg img {	margin-bottom: 40px;	width: 100%;}

.hdr_locations {
	float: right;
	margin: 5px 10px 0;
	width: 200px;
	text-align: center;
}
.hdr_locations a {
	color: #000;
	text-decoration: none;
	display: block;
	padding: 5px 15px;
	line-height: 19px;
	background: #ffd500;
	font-weight: bold;
	font-size: 13px;
}
.hdr_locations a:hover {
	color: #fff;
	background: #2f1e17;
}

/*-- social --*/
.hdr_xsocial { float: right; margin-bottom: 11px; }
.hdr_xsocial a {
	background-image:url(/images/shanes-xsocial-001.png) ;
	height: 19px;
	width: 28px;
	display: block;
	float: left;
	background-repeat: no-repeat;
	/*margin-left: 8px;*/
	cursor: pointer;
	margin-top: 10px;
}
.hdr_xsocial a.hfb { background-position: 1px 0px; }
.hdr_xsocial a.hfb:hover { opacity: .75; }
.hdr_xsocial a.htw { background-position: -19px 0px; }
.hdr_xsocial a.htw:hover { opacity: .75; }


nav {
	/*width: 78%;*/
	float:right;
	margin: auto;
	z-index: 10;
	position: relative;
}

.nav-bg {
	background:url(/images/background-patterns/shanes-navbg-001.jpg) repeat-x 0 0 transparent;
	height: 70px;
	width: 100%;
	position: absolute;
	top: 40px;
	z-index: 0;
