	background: url(data:image/svg+xml;base64,);
	background: -moz-linear-gradient(top,  #2f1d15 0%, #1f120c 100%); /* FF3.6+ */
	background: -webkit-gradient(linear, left top, left bottom, color-stop(0%,#2f1d15), color-stop(100%,#1f120c)); /* Chrome,Safari4+ */
	background: -webkit-linear-gradient(top,  #2f1d15 0%,#1f120c 100%); /* Chrome10+,Safari5.1+ */
	background: -o-linear-gradient(top,  #2f1d15 0%,#1f120c 100%); /* Opera 11.10+ */
	background: -ms-linear-gradient(top,  #2f1d15 0%,#1f120c 100%); /* IE10+ */
	background: linear-gradient(to bottom,  #2f1d15 0%,#1f120c 100%); /* W3C */
	filter: progid:DXImageTransform.Microsoft.gradient( startColorstr='#2f1d15', endColorstr='#1f120c',GradientType=0 ); /* IE6-8 */
/*--*/
	-webkit-box-shadow: inset 0px 8px 20px 0px rgba(0, 0, 0, .5);
	box-shadow: inset 0px 8px 20px 0px rgba(0, 0, 0, .5);
