$(function() {
	if(!Modernizr.input.placeholder) {
		$('[placeholder]').focus(function() {
			var input = $(this);
			if (input.val() == input.attr('placeholder')) {
				input.val('');
				input.removeClass('placeholder');
			}
		}).blur(function() {
			var input = $(this);
			if (input.val() === '' || input.val() == input.attr('placeholder')) {
				input.addClass('placeholder');
				input.val(input.attr('placeholder'));
			}
		}).blur();

		$('[placeholder]').parents('form').submit(function() {
			$(this).find('[placeholder]').each(function() {
				var input = $(this);
				if (input.val() == input.attr('placeholder')) {
					input.val('');
				}
			});
		});
	}

	if ($('#xlbx').length > 0) {
		$('#xlbx a').lightBox();
	}

	if ($('.flexslider').length > 0) {
		$('.flexslider').flexslider({
			animation: 'slide',
			slideshow: true
		});

		$('#show-map').click(function() {
			var $this = $(this),
				selector = '.front, .back',
				targetClass = 'rotate';

			if (!Modernizr.csstransforms3d) {
				selector = '.card.front';
				targetClass = 'hide';
			}

			if (!$(selector).hasClass(targetClass)) {
				$('.tape').hide();
				var t1 = window.setTimeout(function() {
					$this.text('Hide Map');
					$('.tape').fadeIn();
					window.clearTimeout(t1);
				}, 600);
			} else {
				$('.tape').hide();
				var t2 = window.setTimeout(function() {
					$this.text('Show Map');
					$('.tape').fadeIn();
					window.clearTimeout(t2);
				}, 600);
			}

			$(selector).toggleClass(targetClass);
		});
	}

	if ($('.ls-widget').find('.btn').length > 0) {
		var $widget = $('.ls-widget'),
			$btn = $widget.find('.btn');

		$btn.on('click', function(evt) {
			var phoneNumber = $('#plum-mobile').val().replace(/[^0-9]+/g, '');
			evt.preventDefault();
			if (phoneNumber.length < 10 || phoneNumber.length > 10) {
				alert('Please enter a valid phone number: (555) 555-1234');
				return false;
			}
			$btn.css({
				'background-image': 'url(/images/ajax-loader.gif)',
				'background-repeat': 'no-repeat',
				'background-position': '84px 6px',
				'background-size': '15%'
			});
			$.ajax({
				url: '/fm/index/plumrewards',
				type: 'POST',
				dataType: 'json',
				data: {
					deviceId: $('#plum-device-id').val(),
					mobile: phoneNumber
				},
				success: function(data) {
					$btn.css({'background-image': ''});
					alert(data.message);
					$('#plum-mobile').val('');
				},
				error: function(data, status) {
					$btn.css({'background-image': ''});
					alert(data.message);
				}
			});
		});
	}
});


